import React, { Component }  from 'react';
import MovieCard from '../Components/Moviecard';

function Series(props) {

  const {movies} = props;

  return (
    <ul>

      {movies.map((item,key) =>
        <ul className='Home' key={key}> 
          <MovieCard movie={item}/>


         </ul>


      )}


    </ul>

  );
}

